import React from "react";
import Accordian from "../Components/accordians";
import SectionWithImg from "../Components/sectionWithImage";

function Services() {
  return (
    <React.Fragment>
      <div className="d-flex">
        <div>
          <h2>HEllooo...</h2>
        </div>
        <div className="mx-5 d-flex" style={{ width: "100%" }}>
          <div className="d-flex-column" style={{ width: "100%" }}>
            <Accordian count="01" />
            <Accordian count="02" />
          </div>
          <div className="d-flex-column" style={{ width: "100%" }}>
            <Accordian count="03" />
            <Accordian count="04" />
          </div>
        </div>
      </div>
      <SectionWithImg />
    </React.Fragment>
  );
}

export default Services;
